import React from "react";

const headerStyle = {
  color: '#f3be85',
  padding: '20px',
  display: 'flex',
  justifyContent: 'space-between'
}


const Header = () => {
  return (
    <div>
      <style jsx>{`
          .header {
             color: #e3880f;
             padding: 25px;
             display: flex;
             justifyContent: space-between;
             background: white;
          }

          section h1{
            margin: 0px;
            font-size: 30px;
          }

          section p{
             color: white;
            margin: 0px;
          } 

          ul {
            list-style:none;
            display: flex;
            height: 30PX;
            font-size: 20px;
          }

          ul li {
            margin: 0px 12px;
            color: white;
            cursor: pointer;
          }

           ul li:hover {
             color: #e3880f;
           }

           ul li a {
            text-decoration: none;
            margin: 10px;
          }


      `}</style>
      <header className="header" style={headerStyle}>
        <section>
          <h1>ViajaEnVan</h1>
          <p>Vivamos la experiencia de viajar juntos</p>
        </section>
        <ul>
          <li>Inicio</li>
          <li>Destinos</li>
          <li>Servicios</li>
          <li>Cotactenos</li>
        </ul>
      </header>
    </div>
  );
};

export default Header;
